''' 1345. Jump Game IV

Hard        2.3K        89          Companies

Given an array of integers arr, you are initially positioned at the first
index of the array.

In one step you can jump from index i to index:

 * i + 1 where: i + 1 < arr.length.
 * i - 1 where: i - 1 >= 0.
 * j where: arr[i] == arr[j] and i != j.

Return the minimum number of steps to reach the last index of the array.

Notice that you can not jump outside of the array at any time.


Example 1:
Input: arr = [100, -23, -23, 404, 100, 23, 23, 23, 3, 404]
Output: 3
Explanation: You need three jumps from index 0 --> 4 --> 3 --> 9.
Note that index 9 is the last index of the array.

Example 2:
Input: arr = [7]
Output: 0
Explanation: Start index is the last index. You do not need to jump.

Example 3:
Input: arr = [7, 6, 9, 6, 9, 6, 9, 7]
Output: 1
Explanation: You can jump directly from index 0 to index 7 which is last
index of the array.
 

Constraints:        1 <= arr.length <= 5 * 10^4
                    -10^8 <= arr[i] <= 10^8
Accepted:           85.4K
Submissions:        194.4K
Acceptance Rate:    43.9%

'''

from typing import List

class Solution:     # My BFS   Passed
    def minJumps(self, arr: List[int]) -> int:
        N = len(arr)
        if N == 1: return 0
        if arr[0] == arr[-1]: return 1

        map = {}
        for i, a in enumerate(arr):
            if a in map: map[a].append(i)
            else: map[a] = [i]
        
        q, step, seen = [0], 0, set()
        while q:
            next = []
            while q:
                idx = q.pop()
                if idx == N - 1: return step
                seen.add(idx)
                for neighbor in [idx - 1, idx + 1]:
                    if 0 < neighbor < N and neighbor not in seen:
                        next.append(neighbor)
                        seen.add(neighbor)
                if arr[idx] in map:
                    for v in map[arr[idx]]:
                        if v not in seen:
                            next.append(v)
                            seen.add(v)
                    del map[arr[idx]]
            q = next.copy()
            step += 1

        return -1

