class Solution_v2:   # Java to Python
    def minJumps(self, arr: List[int]) -> int:
        steps, n = 0, len(arr)
        hm = {}
        for i in range(n):
            if arr[i] in hm: hm[arr[i]].append(i)
            else: hm[arr[i]] = [i]
        # print(hm)
        vis = [False for _ in range(n)]
        vis[0] = True
        qu = [0]
        while qu:
            size = len(qu)
            # print("\n qu:", qu)
            for i in range(size):
                curridx = qu.pop(0)
                if curridx == n - 1: return steps
                jumptoindexes = hm[arr[curridx]]
                jumptoindexes.append(curridx + 1)
                jumptoindexes.append(curridx - 1)
                # print("jumptoindexes:", jumptoindexes)
                for q in jumptoindexes:
                    if q >= 0 and q < n and not vis[q]:
                        vis[q] = True
                        qu.append(q)
                jumptoindexes = []
            steps += 1
        return - 1

class Solution_v3(object):
    def minJumps(self, arr):
        n = len(arr)
        if n == 1: return 0
        
        # Build a dictionary to store the positions of each value in the array
        positions = {}
        for i in range(n):
            if arr[i] not in positions: positions[arr[i]] = []
            positions[arr[i]].append(i)
        
        # BFS algorithm to find the minimum number of jumps
        visited = set()
        q = [(0, 0)]  # (position, jumps)
        while q:
            pos, jumps = q.pop(0)
            
            # Check if we've reached the end of the array
            if pos == n - 1: return jumps
            
            # Jump to adjacent indices
            for next_pos in [pos - 1, pos + 1]:
                if 0 <= next_pos < n and next_pos not in visited:
                    visited.add(next_pos)
                    q.append((next_pos, jumps + 1))
            
            # Jump to indices with the same value
            if arr[pos] in positions:
                for next_pos in positions[arr[pos]]:
                    if next_pos not in visited:
                        visited.add(next_pos)
                        q.append((next_pos, jumps + 1))
                
                # We don't need to keep track of the positions anymore
                del positions[arr[pos]]
        
        return -1  # It's not possible to reach the end of the array

